import React from 'react';

const ProjectShowcase: React.FC = () => {
    const projects = [
        { title: 'Project 1', description: 'Lorem ipsum odor amet, consectetuer adipiscing elit. Leo ad amet ultricies nullam maecenas ipsum leo. Mattis ullamcorper arcu mauris justo per tincidunt congue dapibus. Proin nec purus nullam nibh augue aliquet euismod. Sed convallis metus facilisi mus mollis sollicitudin nisl. Gravida vulputate himenaeos dignissim porttitor nostra non montes amet sem. Sit interdum consectetur viverra maecenas nisi fames morbi est dignissim. Euismod sodales tellus suscipit eros turpis.', 
            imageUrl: 'https://via.placeholder.com/150' },
        { title: 'Project 2', description: 'Description of project 2', imageUrl: 'https://via.placeholder.com/150' },
        { title: 'Project 3', description: 'Description of project 3', imageUrl: 'https://via.placeholder.com/150' },
    ];

    return (
        <div className="project-showcase">
            <h2>Recent Projects</h2>
            <ul>
                {projects.map((project, index) => (
                    <li key={index} className="project-item">
                         <h3>{project.title}</h3>
                        <img src={project.imageUrl} alt={project.title} className="project-image" />    
                        <p>{project.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ProjectShowcase;
